using AssemblyLib.Utils;using System;using System.Collections.Generic;using System.Collections.ObjectModel;using System.Linq;using System.Text;using System.Threading.Tasks;namespace AssemblyLib.AssemblyModels{	public class StructureIFRTInputModel : Notifier	{		public StructureIFRTInputModel()		{					TankID = "";			TankHeight = "";			RoofSlope = "";			SupportingType = "";		}				private string _TankID;		public string TankID			{				get { return _TankID; }				set				{					_TankID = value;					OnPropertyChanged(nameof(TankID));				}			}				private string _TankHeight;		public string TankHeight			{				get { return _TankHeight; }				set				{					_TankHeight = value;					OnPropertyChanged(nameof(TankHeight));				}			}				private string _RoofSlope;		public string RoofSlope			{				get { return _RoofSlope; }				set				{					_RoofSlope = value;					OnPropertyChanged(nameof(RoofSlope));				}			}				private string _SupportingType;		public string SupportingType			{				get { return _SupportingType; }				set				{					_SupportingType = value;					OnPropertyChanged(nameof(SupportingType));				}			}			}}